import './App.css';
import {Login} from "./components/login";
import {Register} from "./components/register";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./App.css";  

export const App = () => {



  return (
    <div className="container">
      <Router>
        <Switch>
          <Route exact path="/">
            <Login/>
          </Route>
          <Route expect path="register">
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
